import React from 'react';

function SignupModal({ isVisible, onClose }) {
  if (!isVisible) return null;

  return (
    <div className="modal">
      <button onClick={onClose}>Close</button>
      <form>
        {/* Signup form fields */}
        <button type="submit">Sign Up</button>
      </form>
    </div>
  );
}

export default SignupModal;
